Ankara'da bulunan üniversitelerin hayvan hakları topluluklarıyla bir araya geldik. Birlikten kuvvet doğar, bilgi güçtür dedik ve çok önemli kararlar aldık.
-Her ay düzenli toplantılarla topluluk gündemi değerlendirmeleri gerçekleştireceğiz.
-Sorunlara en makul çözümleri üretmek için fikir alışverişinde bulunacağız.
-Aylık toplantılarımızı sırasıyla kampüslerimizde gerçekleştirerek hem alanlarımızı tanıma şansı bulunacağız hem de bölgedeki sorunları gözlemleyerek çözümlendirmeyi hızlandıracağız.
-Ankara bölgesinde bulunan bakımevi ziyaretlerini toplu halde gerçekleştireceğiz.
-Toplu etkinlikler planlayacağız.
